    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE - col0 IN ( - col2 * + + col2 + + 66, + col0 / - col2 - col1, - 23, + - col0 );
  - name: tab2

outputs:
  - name: q11647.out
    data: |
      46	51	23
      64	77	40
      75	67	58
